import React from 'react';
import './App.css';
import Category from './components/Category/Category.jsx';


function App() {

  return (
    <>
      <Category key={i} name="All Categories"></Category>
      {categories &&
        categories.map((category, i) => (
          <Category key={i} name={category}></Category>
        ))}
    </>
  );
}

export default App;
